import React,{useState} from 'react';
import {useNavigate} from 'react-router-dom';
import axios from 'axios';
import './signup.css'
import './login'
const Signup = () => {
    const Navigate=useNavigate();
    const [formData, setFormData] = useState({Email:"",Password:"",ConfirmPassword:""});
 


    const Senddata = () => {
      axios({
          url: "http://localhost:3000/signup",
          method: "POST",
          headers: {
  
          },
          data: {Email: formData.Email, Password: formData.Password,ConfirmPassword:formData.ConfirmPassword}
      }).then((res) => {
          console.log(res)
          Navigate("/login")
      }).catch((err) => {
          console.log(err)
      })
    }
   
  return (
    <div>
      <div className='signup_container'>
      <form className='signup'>
        <div>
        <h1 className='h1logo'>Logo</h1> <br/>
        <p>Create New Account</p>
         <input type='text' id='email' placeholder='Mail ID' onChange={(e)=>{setFormData({...formData,Email:e.target.value})}}/> <br/>
        <input type='password' id='password' placeholder='Password' onChange={(e)=>{setFormData({...formData,Password:e.target.value})}}/> <br/>
        <input type='password' id='confirmpassword' placeholder='Confirm Password' onChange={(e)=>{setFormData({...formData,ConfirmPassword:e.target.value})}}/>
       
        <button onClick={() => { Navigate("/login") }}>Sign Up</button> <br/>
        
        </div>
    
        </form>
        <p className='signinfooter' onClick={() => { Navigate("/login") }}>Sign in</p>
    </div>
    
    
    </div>
  )
}

export default Signup
